import logo from './logo.svg';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route } from "react-router-dom";

import Navbar from "./components/navbar.component";
import ScorecardsList from "./components/scorecards-list.component";
import EditScorecards from "./components/edit-scorecards.component";
import CreateScorecard from "./components/create-scorecard.component";
import CreateUser from "./components/create-user.component";
import CreateCourse from "./componenets/create-course.component";

function App() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/" exact component = {ScorecardsList} />
        <Route path="/edit/:id" component = {EditScorecards} />
        <Route path="/create" component = {CreateScorecard} />
        <Route path="/user" component = {CreateUser} />
        <Route path="/course" component = {CreateCourse} />
      </div>
    </Router>
  );
}

export default App;
